import React, { Component } from 'react';

class StrapiAuth extends Component {

  constructor(props) {
    super(props);

    this.state = {
      user: []
    }
  }

  render() {
    return(
      <div>
        <h1>DUBZOO</h1>
        <button>LOGIN</button>
      </div>
    );
  }
}
